import React from "react";

const Booklist = () => {
  return (
    <div
      className="main"
      style={{
        display: "flex",
        flexDirection: "column"
      }}
    >
      <div
        className="main-headers"
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          marginTop: "50px",
          padding: "1.5% 10% 1.5% 10%",
          backgroundColor: "teal",
          fontSize: "20px"
        }}
      >
        <p>Title</p>
        <p>Author</p>
        <p>ISBN</p>
        <p>READ?</p>
      </div>

      <div
        className="main-books"
        style={{
          display: "flex",
          justifyContent: "space-between",
          padding: "0% 10% 0% 10%"
        }}
      >
        <p>HELLO</p>
        <p>HELLO</p>
        <p>HELLO</p>
        <p>HELLO</p>
      </div>

      <div className="main-inputs">
        <input type="text" placeholder="title"></input>
        <input type="text" placeholder="author"></input>
        <input type="text" placeholder="isbn"></input>
        <input type="checkbox"></input>
      </div>
    </div>
  );
};

export default Booklist;
